import React from "react";
import { Section, Container, Icons } from "./ProfileElements";

function Profile() {
  return (
    <Section>
      <Container>
        <Icons>
          <p>Notifications</p>
        </Icons>
        <Icons>
          <p>Settings</p>
        </Icons>
        <Icons>
          <p>Terms & Conditions</p>
        </Icons>
        <Icons>
          <p>History</p>
        </Icons>
        <Icons>
          <p>Help</p>
        </Icons>
      </Container>
    </Section>
  );
}

export default Profile;
